import {useState} from 'react';
import BlogList from  './BlogList'
const Home = () => {
    const [blogs, setblogs] = useState([
        {title:'My new website',body:'lorem',author:'mario',id:1},
        {title:'Welcome',body:'lorem',author:'yoshi',id:2},
        {title:'Hello',body:'lorem',author:'luigi',id:3}
    ]);
        return (
        <div className="home">
           <BlogList blogs={blogs} title="All Blogs!"></BlogList>
           <BlogList blogs={blogs.filter((blog)=> blogs.author ==='mario')} title="Mario's Blogs!"></BlogList>
        </div>
    );
}

export default Home
